branch-defaults:
  staging:
    environment: Telos-Admin-Meeting-staging
environment-defaults:
  Telos-Admin-Meeting-staging:
    branch: null
    repository: null
global:
  application_name: Telos-Admin-Meeting
  default_ec2_keyname: telos-prod
  default_platform: arn:aws:elasticbeanstalk:ap-southeast-1::platform/Node.js running
    on 64bit Amazon Linux/4.4.4
  default_region: ap-southeast-1
  include_git_submodules: true
  instance_profile: null
  platform_name: null
  platform_version: null
  profile: eb-cli
  sc: git
  workspace_type: Application
